import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
    const [data, setData] = useState([]);
    const [newCar, setNewCar] = useState({ modelo: '', marca: '', ano: '', categoria: '', disponibilidade: '' });
    const [editCar, setEditCar] = useState(null); // Estado para o carro em edição

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        fetch('http://localhost:25000/data')
            .then(response => response.json())
            .then(data => setData(data))
            .catch(error => console.error("Erro ao buscar os dados:", error));
    };

    const handleAddCar = () => {
        // Envia o novo carro para o backend
        fetch('http://localhost:25000/data', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify(newCar)
        })
        .then(() => {
            fetchData(); // Atualiza a lista após adicionar
            setNewCar({ modelo: '', marca: '', ano: '', categoria: '', disponibilidade: '' });
        })
        .catch(error => console.error("Erro ao adicionar o carro:", error));
    };

    const handleEditCar = (car) => {
        setEditCar(car); // Define o carro em edição
    };

    const handleUpdateCar = () => {
        fetch(`http://localhost:25000/data/${editCar.id}`, {
            method: 'PUT',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify(editCar)
        })
        .then(() => {
            fetchData(); // Atualiza a lista após editar
            setEditCar(null);
        })
        .catch(error => console.error("Erro ao atualizar o carro:", error));
    };

    const handleDeleteCar = (id) => {
        fetch(`http://localhost:25000/data/${id}`, {
            method: 'DELETE',
        })
        .then(() => fetchData()) // Atualiza a lista após deletar
        .catch(error => console.error("Erro ao deletar o carro:", error));
    };

    return (
        <div className="App">
            <h1>Car List</h1>
            <table>
                <thead>
                    <tr>
                        <th>Modelo</th>
                        <th>Marca</th>
                        <th>Ano</th>
                        <th>Categoria</th>
                        <th>Disponibilidade</th>
                        <th>Ações</th>
                    </tr>
                </thead>
                <tbody>
                    {Array.isArray(data) && data.map(car => (
                        <tr key={car.id}>
                            <td>{car.modelo}</td>
                            <td>{car.marca}</td>
                            <td>{car.ano}</td>
                            <td>{car.categoria}</td>
                            <td>{car.disponibilidade}</td>
                            <td>
                                <button onClick={() => handleEditCar(car)}>Editar</button>
                                <button onClick={() => handleDeleteCar(car.id)}>Excluir</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h2>Adicionar Carro</h2>
            <input
                type="text"
                placeholder="Modelo"
                value={newCar.modelo}
                onChange={(e) => setNewCar({ ...newCar, modelo: e.target.value })}
            />
            <input
                type="text"
                placeholder="Marca"
                value={newCar.marca}
                onChange={(e) => setNewCar({ ...newCar, marca: e.target.value })}
            />
            <input
                type="number"
                placeholder="Ano"
                value={newCar.ano}
                onChange={(e) => setNewCar({ ...newCar, ano: e.target.value })}
            />
            <input
                type="text"
                placeholder="Categoria"
                value={newCar.categoria}
                onChange={(e) => setNewCar({ ...newCar, categoria: e.target.value })}
            />
            <input
                type="text"
                placeholder="Disponibilidade"
                value={newCar.disponibilidade}
                onChange={(e) => setNewCar({ ...newCar, disponibilidade: e.target.value })}
            />
            <button onClick={handleAddCar}>Adicionar</button>

            {editCar && (
                <div>
                    <h2>Editar Carro</h2>
                    <input
                        type="text"
                        placeholder="Modelo"
                        value={editCar.modelo}
                        onChange={(e) => setEditCar({ ...editCar, modelo: e.target.value })}
                    />
                    <input
                        type="text"
                        placeholder="Marca"
                        value={editCar.marca}
                        onChange={(e) => setEditCar({ ...editCar, marca: e.target.value })}
                    />
                    <input
                        type="number"
                        placeholder="Ano"
                        value={editCar.ano}
                        onChange={(e) => setEditCar({ ...editCar, ano: e.target.value })}
                    />
                    <input
                        type="text"
                        placeholder="Categoria"
                        value={editCar.categoria}
                        onChange={(e) => setEditCar({ ...editCar, categoria: e.target.value })}
                    />
                    <input
                        type="text"
                        placeholder="Disponibilidade"
                        value={editCar.disponibilidade}
                        onChange={(e) => setEditCar({ ...editCar, disponibilidade: e.target.value })}
                    />
                    <button onClick={handleUpdateCar}>Atualizar</button>
                </div>
            )}
        </div>
    );
}

export default App;
